(21,"SECOND HAND DAN ANNOUNCEMENT","{\"body\": {\"id\": \"khtI1tz56V\", \"rows\": [{\"id\": \"RoHhcpn2QY\", \"cells\": [1], \"values\": {\"_meta\": {\"htmlID\": \"u_row_1\", \"htmlClassNames\": \"u_row\"}, \"anchor\": \"\", \"columns\": false, \"padding\": \"0px\", \"hideable\": true, \"deletable\": true, \"draggable\": true, \"selectable\": true, \"hideDesktop\": false, \"duplicatable\": true, \"backgroundColor\": \"\", \"backgroundImage\": {\"url\": \"\", \"size\": \"custom\", \"repeat\": \"no-repeat\", \"position\": \"center\", \"fullWidth\": true}, \"displayCondition\": null, \"columnsBackgroundColor\": \"\"}, \"columns\": [{\"id\": \"Vae5c9ZQ_J\", \"values\": {\"_meta\": {\"htmlID\": \"u_column_1\", \"htmlClassNames\": \"u_column\"}, \"border\": {}, \"padding\": \"0px\", \"backgroundColor\": \"\"}, \"contents\": [{\"id\": \"UYYs6Rm7SN\", \"type\": \"heading\", \"values\": {\"text\": \"<span><span>IMPORTANT NEWS</span></span>\", \"_meta\": {\"htmlID\": \"u_content_heading_1\", \"htmlClassNames\": \"u_content_heading\"}, \"color\": \"#ff0000\", \"anchor\": \"\", \"fontSize\": \"14px\", \"hideable\": true, \"deletable\": true, \"draggable\": true, \"linkStyle\": {\"inherit\": true, \"linkColor\": \"#0000ee\", \"linkUnderline\": true, \"linkHoverColor\": \"#0000ee\", \"linkHoverUnderline\": true}, \"textAlign\": \"center\", \"lineHeight\": \"140%\", \"selectable\": true, \"headingType\": \"h4\", \"hideDesktop\": false, \"duplicatable\": true, \"containerPadding\": \"10px\", \"displayCondition\": null}}, {\"id\": \"1Vim0qbLdH\", \"type\": \"text\", \"values\": {\"text\": \"<p style=\\\"line-height: 140%;\\\">SCALISE</p>\", \"_meta\": {\"htmlID\": \"u_content_text_1\", \"htmlClassNames\": \"u_content_text\"}, \"anchor\": \"\", \"fontSize\": \"95px\", \"hideable\": true, \"_override\": {\"mobile\": {\"fontSize\": \"65px\"}}, \"deletable\": true, \"draggable\": true, \"linkStyle\": {\"inherit\": true, \"linkColor\": \"#0000ee\", \"linkUnderline\": true, \"linkHoverColor\": \"#0000ee\", \"linkHoverUnderline\": true}, \"textAlign\": \"center\", \"fontFamily\": {\"url\": \"https://fonts.googleapis.com/css?family=Raleway:400,700\", \"label\": \"Raleway\", \"value\": \"\'Raleway\',sans-serif\", \"weights\": [400, 700], \"defaultFont\": true}, \"lineHeight\": \"140%\", \"selectable\": true, \"hideDesktop\": false, \"duplicatable\": true, \"containerPadding\": \"10px\", \"displayCondition\": null}}, {\"id\": \"QeNsPgxaKx\", \"type\": \"text\", \"values\": {\"text\": \"<h4 style=\\\"color: inherit; white-space: normal; background-color: #000000; margin: 0px 0px 0.5em; line-height: 1.25em; text-align: center;\\\">Hey everybody! We have some important news.</h4>\\n<p style=\\\"line-height: 140%;\\\"> </p>\\n<h4 style=\\\"color: inherit; white-space: normal; background-color: #000000; margin: 0px 0px 0.5em; line-height: 1.25em; text-align: center;\\\">\\\"Scalise\\\" is no more.</h4>\\n<p style=\\\"line-height: 140%;\\\"> </p>\\n<h4 style=\\\"color: inherit; white-space: normal; background-color: #000000; margin: 0px 0px 0.5em; line-height: 1.25em; text-align: center;\\\">After careful consideration, we\'ve decided to change the band name</h4>\\n<h4 style=\\\"color: inherit; white-space: normal; background-color: #000000; margin: 0px 0px 0.5em; line-height: 1.25em; text-align: center;\\\">Years of mispronunciations, misspellings, failed google searches, and assumed affiliations have led to this moment</h4>\\n<p style=\\\"line-height: 140%;\\\"> </p>\\n<p style=\\\"line-height: 140%;\\\"> </p>\\n<h4 style=\\\"color: inherit; white-space: normal; background-color: #000000; margin: 0px 0px 0.5em; line-height: 1.25em; text-align: center;\\\">We\'re excited to announce the new name:</h4>\\n<p style=\\\"line-height: 140%;\\\"> </p>\", \"_meta\": {\"htmlID\": \"u_content_text_2\", \"htmlClassNames\": \"u_content_text\"}, \"anchor\": \"\", \"fontSize\": \"24px\", \"hideable\": true, \"deletable\": true, \"draggable\": true, \"linkStyle\": {\"body\"